import React from 'react'
import ReactDOM from 'react-dom';
import logo from '/Users/rapcha/Desktop/fetty-tech/src/assets/images/Consumer_Wordmark.svg';

const Header = () => {
    return (
        <nav>
            <div className="header__wrapper">
                {/* coinbase logo */}
                <div className="logo">
                <img src={logo} alt="coinbase-logo" />
                </div>

                {/* navigation links */}
                <ul className="middle__links">
                <li>Price</li>
                <li>Learn</li>
                <li>Individuals</li>
                <li>Businesses</li>
                <li>Developers</li>
                <li>Company</li>
                </ul>

                {/* user portal links */}
                <ul className="auth__links">
                <li className="signin">sign in</li>
                <li className="get__started">Get started</li>
                </ul>
            </div>
        </nav>
    );       
}

export default Header;
